const initialState = {
    mainPosts:[{
        id:1,
        user:{
            id:1,
            nickname:"rsua",
        },
        content:"my first post",
        Images:[{
            src:""
        },
        {
            src:""
        },
        {
            src:""
        }],
        Comments:[{
            user:{
                nickname:"foxbox"
            },
            content:"wow good"
        },{
            user:{
                nickname:"rrr"
            },
            content:"holy shit"
        }],
    }],
}

const postReducer = (state=initialState,action)=>{
    switch(action.type){
        default :
            return state;
    }
}

export default postReducer;
